import { ethers } from 'ethers';
import OOV3 from './out/OptimisticOracleV3.sol/OptimisticOracleV3.json' assert { type: 'json' }

import assertedLogs from './oracle_events/AssertionMade.json' assert { type: 'json' } //TODO: UPDATE IMPORT & REMOVE STATIC DATA AT BOTTOM OF FILE
import disputedLogs from './oracle_events/AssertionDisputed.json' assert { type: 'json' } //TODO: UPDATE IMPORT & REMOVE STATIC DATA AT BOTTOM OF FILE
import settledLogs from './oracle_events/AssertionSettled.json' assert { type: 'json' } //TODO: UPDATE IMPORT & REMOVE STATIC DATA AT BOTTOM OF FILE

const iface = new ethers.Interface(OOV3.abi)

const topics = {
    AssertionSettled: '0xf4fa324b13daeb4e1aae736c2553632ae0fb16fb31f2d4da8ac99fd056313a13',
    AssertionDisputed: '0x60133788b013c89f2a3756dbc47e3484997b87bd7e0af98a7d70232032c1ce2b',
    AssertionMade: '0xdb1513f0abeb57a364db56aa3eb52015cca5268f00fd67bc73aaf22bccab02b7',
}

const oracleState = [];

function getOracleState() {
    // parse AssertionMade events
    assertedLogs.forEach((log) => {
        const { args } = iface.parseLog(log)

        // determine initial status
        const expirationTime = Number(args[7])
        var status = 'Asserted';
        if (expirationTime < Date.now() / 1000) {
            status = 'Expired'
        }

        //handle claims that can not be converted to UTF9
        var claim;
        try {
            claim = ethers.toUtf8String(args[2])
        } catch (error) {
            claim = args[2]
        }

        oracleState.push({
            assertionId: args[0],
            claim: claim,
            asserter: args[3],
            callbackRecipient: args[4],
            expirationTime: expirationTime,
            currency: args[8],
            bond: args[9],
            identifier: ethers.toUtf8String(args[10]),
            status: status,
            assertionTxHash: log.transactionHash
        })
    })

    // parse AssertionDisputed events
    disputedLogs.forEach((log) => {
        const { args } = iface.parseLog(log)
        const index = oracleState.findIndex((assertion) => assertion.assertionId === args[0])
        if (oracleState[index]) {
            oracleState[index].status = 'Disputed'
            oracleState[index].disputer = args[2]
            oracleState[index].disputed = true
            oracleState[index].disputeTxHash = log.transactionHash
        }
    })

    // parse AssertionSettled events
    settledLogs.forEach((log) => {
        const { args } = iface.parseLog(log)
        const index = oracleState.findIndex((assertion) => assertion.assertionId === args[0])
        if (oracleState[index]) {
            oracleState[index].status = 'Settled'
            oracleState[index].settlementResolution = args[3]
            oracleState[index].settleCaller = args[4]
            oracleState[index].SettleTxHash = log.transactionHash
        }
    })

    console.log(`\n`)
    console.log('----------------------------------------------------------------------------------')
    console.log('----------------------------------------------------------------------------------')
    console.log("SANDBOX ORACLE STATE")
    console.log('----------------------------------------------------------------------------------')
    console.log('----------------------------------------------------------------------------------')
    console.log('ChainId: 5') //TODO: REMOVE HARD CODING
    console.log('OOV3 Address: 0x0DCd1Bf9A1b36cE34237eEaFef220932846BCD82') //TODO: REMOVE HARD CODING
    console.log(`\n`)

    oracleState.forEach((x) => {
        console.log('\n----------------------------------------------------------------------------------')
        console.log(`Assertion ID: ${x.assertionId}`)
        console.log('----------------------------------------------------------------------------------')

        console.group()

        console.log(`Claim: ${x.claim}`)
        console.log(`Identifier: ${x.identifier}`)

        if (x.status === 'Settled') {
            console.log(`Status: ${x.status} | Settlement Resolution: ${x.settlementResolution} | Disputed: ${x.disputed ? 'true' : 'false'}`)
        } else if (x.status === 'Asserted') {
            console.log(`Status: ${x.status} | Expiration Time: ${x.expirationTime} (in ${new Date(Number(x.expirationTime) - (Date.now() / 1000)).toTimeString().replace(/.*(\d{2}:\d{2}:\d{2}).*/, "$1")})`) // TODO: fix countdown
        } else console.log(`Status: ${x.status}`)

        console.log(`\nCurrency: ${x.currency}`)
        console.log(`Bond: ${x.bond}`)
        console.log(`Callback Recipient: ${x.callbackRecipient}`)

        console.log(`\nAsserter: ${x.asserter}`)
        console.log(`Assertion Tx Hash: ${x.assertionTxHash}`)
        if (x.status === 'Disputed') {
            console.log(`Disputer: ${x.disputer}`)
            console.log(`Dispute Tx Hash: ${x.disputeTxHash}`)
        }
        if (x.status === 'Settled') {
            console.log(`Settle Caller: ${x.settleCaller}`)
            console.log(`Settle Tx Hash: ${x.SettleTxHash}`)
        }
        console.groupEnd()
    })
    console.log(`\n`)

    console.log('----------------------------------------------------------------------------------')
    console.log("COMMANDS TO INTERACT WITH THE SANDBOXED ORACLE")
    console.log('----------------------------------------------------------------------------------')
    console.log("To dispute an assertion with status 'asserted', run: XXX") //TODO: UPDATE SCRIPT
    console.log("To resolve an assertion with status 'disputed', run: YYY") //TODO: UPDATE SCRIPT
    console.log("To settle an assertion with status 'expired', run: ZZZ") //TODO: UPDATE SCRIPT
    console.log('----------------------------------------------------------------------------------')
    console.log(`\n`)
}

